import React from 'react';
import PropTypes from 'prop-types';
import styled from 'styled-components';

const Wrapper = styled.div`
  position: fixed;
  bottom: 0;
  left: 0;
  right: 0;
  height: 30%;
  background-color: white;
`;

const Stats = props => (
  <Wrapper
    className={"stats"}
  >
  <div>
      Total Vehicles: {props.data.length}
      Total Delayed Vehicles: {props.data.filter(i => i.delay > 0)}
  </div>
  </Wrapper>
);

Stats.defaultProps = {
  onClick: null,
};

Stats.propTypes = {
  onClick: PropTypes.func,
  text: PropTypes.string.isRequired,
};

export default Stats;
